import Navbar from "react-bootstrap/Navbar";
import Container from "react-bootstrap/Container";

function Header() {
  return (
    <div className="Header">
      <Navbar bg="light">
        <Container>
          <Navbar.Brand>Clothing Brand</Navbar.Brand>
        </Container>
      </Navbar>
    </div>
  );
}

export default Header;
